class RouteStages:
    def __init__(self, stages, currentStage, calibratePoints):
        self.stages = stages
        self.totalDistance = self.findDistance(self.stages [ 0 ], self.stages [ -1 ])
        self.currentStage = currentStage
        self.calibratePoints = calibratePoints
        self.moveDirection = self.checkMovementDirection(self.calibratePoints, None)

    def findDistance(self, loc1: list, loc2: list):
        distance = ox.distance.great_circle(loc1 [ 0 ], loc1 [ 1 ], loc2 [ 0 ], loc2 [ 1 ])
        return distance

    def checkMovementDirection(self, calibratePoints: list, referDirection):
        startOne = self.findDistance(self.stages [ 0 ], calibratePoints [ 0 ])
        startTwo = self.findDistance(self.stages [ 0 ], calibratePoints [ 1 ])
        endOne = self.findDistance(self.stages [ -1 ], calibratePoints [ 0 ])
        endTwo = self.findDistance(self.stages [ -1 ], calibratePoints [ 1 ])
