    def findNearestStage(self, loc: list):
        if self.moveDirection == "DOWN":
            if self.currentStage < len(self.stages)-1:
                subTotalDistance = self.findDistance(self.stages [ self.currentStage ],
                                                     self.stages [ self.currentStage+1 ])
                distance = self.findDistance(self.stages [ self.currentStage ], loc)
                if distance < subTotalDistance-10:
                    return self.currentStage, round(
                        (distance / subTotalDistance) * 100), distance, subTotalDistance-distance
                self.currentStage += 1
                return self.findNearestStage(loc)
            elif self.currentStage == len(self.stages)-1:
                distance = self.findDistance(self.stages [ self.currentStage ], loc)
                if distance < 10:
                    return self.currentStage, 100, distance
        elif self.moveDirection == "UP":
            if self.currentStage-1 >= 0:
                subTotalDistance = self.findDistance(self.stages [ self.currentStage-1 ],
                                                     self.stages [ self.currentStage ])
                distance = self.findDistance(loc, self.stages [ self.currentStage ])
                if distance < subTotalDistance-10:
                    return self.currentStage, round(
                        (distance / subTotalDistance) * 100), distance, subTotalDistance-distance
                self.currentStage -= 1
                return self.findNearestStage(loc)
            elif self.currentStage == 0:
                distance = self.findDistance(self.stages [ self.currentStage ], loc)
                if distance < 10:
                    return self.currentStage, 100, distance
        if len(self.calibratePoints) < 4:
            self.calibratePoints.append(loc)
            return 'Calibrating Again'
        print(self.calibratePoints)
        self.calibratePoints.pop(0)
        self.calibratePoints.pop(0)
        self.moveDirection = self.checkMovementDirection(self.calibratePoints, self.moveDirection)
        return self.findNearestStage(loc)

    def getMoveDirection(self):
        return self.moveDirection


